    appButtonContainer: {
        elevation: 8,
        backgroundColor: "#002D62",
        borderRadius: 10,
        paddingVertical: 10,
        paddingHorizontal: 12,
        height: 50
    },
    appButtonText: {
        fontSize: 18,
        color: "#fff",
